r($,"aT0","v6",()=>A.b([A.iz("Coffee Application",'Presenting "Coffee" - a Flutter UI application that invites you to indulge in a delightful coffee adventure. Immerse yourself in the world of rich aroma and flavor as you browse through an exquisite selection of specialty coffees. With a user-friendly interface, exploring different blends and discovering their unique details becomes a delightful experience.',"assets/images/coffee.png","https://github.com/gnac-flutter-portfolio/coffee-flutter-ui-app"),A.iz("Fitness Application","The Flutter Fitness App is a sleek, user-friendly mobile application designed to provide a seamless workout experience. It allows users to explore various workout routines, start and track their exercises with timers, and follow along with visual guides. The app integrates with APIs to offer dynamic fitness content, ensuring users always have access to updated routines and fitness tips. Built with Flutter, the app provides smooth navigation and an engaging interface, making it an ideal tool for fitness enthusiasts.","assets/images/flutter_fitness_app.png","https://github.com/gnac-flutter-portfolio/fitness-homework"),A.iz("Flutter TDD Clean Architecture E-Commerce App - EShop","This Flutter E-Commerce App follows a Test-Driven Development (TDD) approach and implements clean architecture principles, ensuring scalable and maintainable code. The app features a user-friendly interface with functionalities such as product browsing, category filtering, detailed product views, and a seamless checkout process. Using the BLoC state management pattern, the app provides efficient and reactive data handling, making it a robust solution for online shopping experiences. Its clean architecture allows for the separation of concerns, promoting modularity and easy testing, perfect for any modern e-commerce platform.","assets/images/ecom_flutter.jpg","https://github.com/gnac-flutter-portfolio/eshop"),A.iz("Flutter e-commerce Application UI Design and Animation","This Flutter E-Commerce App emphasizes modern UI design and smooth animations to create an engaging shopping experience. The app features an elegant onboarding screen, vibrant product displays, and intuitive navigation through various categories. With eye-catching transitions and micro-interactions, it provides a visually appealing and fluid user experience. Built entirely with Flutter, the app demonstrates the power of custom animations to enhance user engagement while maintaining performance, making it a standout in e-commerce design.","assets/images/shopping.jpg","https://github.com/gnac-flutter-portfolio/shopping"),A.iz("Word Search Puzzle Game","This Word Search Puzzle Game, developed with Flutter, offers a fun and interactive way to challenge your vocabulary and quick-thinking skills. Players must find and highlight hidden words from a list, with real-time tracking of both current and best completion times. The game features a clean, colorful interface with a variety of word categories, making it engaging for users of all ages. Whether you're looking for a casual game or a brain workout, this puzzle game provides an entertaining and educational experience.","assets/images/word_puzzlz_game.png","https://github.com/gnac-flutter-portfolio/word_puzzle_game"),A.iz("Furniture Store App design","This Furniture Store App design, created using Flutter, showcases a sleek and modern interface tailored for online furniture shopping. The app features a clean layout with smooth navigation, allowing users to browse various furniture categories, such as chairs and sofas. Each product page offers detailed views, including color options, product descriptions, and pricing. The design prioritizes user experience with intuitive controls for adding items to the cart and switching between product variations. This elegant and minimalist design ensures a seamless shopping experience for users looking for stylish furniture options.","assets/images/furniture.jpg","https://github.com/gnac-flutter-portfolio/funiture-store"),A.iz("Architect App UI/UX Design","This app design focuses on providing a modern and intuitive interface for architects and users looking to explore ready-made room designs. The app features virtual showrooms where users can browse and select pre-designed rooms, such as kitchens, offices, and more. Each design is accompanied by detailed descriptions and pricing. The user can seamlessly navigate through different options and select a room layout that suits their needs. The elegant, geometric shapes and earthy tones in the design elements give the app a sophisticated yet approachable feel, perfect for a professional design environment. This app offers a convenient way to visualize and choose architectural layouts with just a few taps.","assets/images/architect.jpg","https://github.com/gnac-flutter-portfolio/architect-app-ui"),A.iz("Sun Glasses Store",'This app allows users to browse and purchase cat-eye sunglasses. It features a product page with details like price, color options, product details, care instructions, reviews and an "Add to Cart" button. It also showcases a home page with a photo of a woman wearing sunglasses, and the text "Glass for eye" with a "Start shopping" button. It is a user-friendly and visually appealing app for online shopping for sunglasses.',"assets/images/sun_glass.png","https://github.com/gnac-flutter-portfolio/sunglasses-ui"),A.iz("Banking Store UI","A finance management app with a clean and modern interface. The dashboard displays key financial information like account balances, investment portfolios, and spending charts. The design uses a calm and professional color palette, with clear typography and easy-to-navigate sections for managing savings, goals, and user preferences.","assets/images/banking.png","https://github.com/gnac-flutter-portfolio/banking-store-ui"),A.iz("Flutter Music Streaming Application","Neumorphic Audio Player offers a sleek and intuitive way to enjoy your local audio files. Featuring a Neumorphic UI for an elegant, modern look, the app provides smooth animations and a minimalistic design that enhances the user experience. You can browse and play audio directly from the list or access a dedicated player screen with controls for playing, pausing, skipping tracks, and adjusting the volume. With its clean interface and seamless functionality, Neumorphic Audio Player brings simplicity and style to your music experience.","assets/images/music.png","https://github.com/gnac-flutter-portfolio/local-music-player"),A.iz("FinTracker - Expense Tracker App","Smart Expense Tracker makes managing your finances simple and efficient. Track and categorize your expenses, set monthly budgets for different categories, and monitor your spending effortlessly. The app offers detailed reports and statistics to help you analyze your financial habits, and its search and filter features allow you to quickly find specific transactions. You can also export your expense data for further analysis. Take control of your spending with Smart Expense Tracker\u2014your all-in-one solution for smarter financial management.","assets/images/fintracker.jpg","https://github.com/gnac-flutter-portfolio/fintracker"),A.iz("Flutter Habit Tracker App UI + Backend","A dark-mode interface for tracking habits, with an engaging UI that includes task lists, icons for different habit categories, and detailed habit progress. The calendar view allows users to mark dates for specific tasks, while the purple accents add vibrancy against the dark background.","assets/images/habit.png","https://github.com/gnac-flutter-portfolio/habit-tracker-app")],A.a2("u<Kq>")))
